import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './LogingPage'; // Make sure the path is correct
//import PatientRegistrationForm from './PatientRegistrationForm';
import Consultation from './Consultation'
import MyCalendar from './MyCalendar'; // Assuming MyCalendar is in the same folder
//import 'bootstrap/dist/css/bootstrap.min.css';
//import VerticalMenu from './Components/verticalmenu'; // bootstarp
//import 'bootstrap-icons/font/bootstrap-icons.css'; // icon import in bootstrpe



function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<LoginPage />} />
          {/*<Route path="/sign in" element={<PatientRegistrationForm />} />*/}
        </Routes>
       {/*<VerticalMenu/>*/}
       <Consultation/>
       <MyCalendar />

      </div>
    </Router>


  );
}

export default App;
